import axios from 'axios';
import {Component} from 'react'


class TodayIncome extends Component {

    state= {
        dataArray: []
    }

    loadData = ()=>{
        axios.get(window.$domain + 'api/AccDetails/GetTodayEntries')
        .then(todayRecoveryList=>{
            todayRecoveryList.data.map(todayRecovery=>{
                var anInstence = {
                    AccDetails: null,
                    UserDetails: null,
                    Account: null
                };
                anInstence.AccDetails = todayRecovery;
                axios.get(window.$domain + 'api/Accounts/' + todayRecovery.accId)
                .then(
                    Account=>{
                        anInstence.Account = Account.data;
                        axios.get(window.$domain + 'api/Users/GetUserDatailsId/' + Account.userid)
                        .then(
                            user=>{
                                axios.get(window.$domain + 'api/Users/GetUserDatailsId/' + user.data)
                                .then(
                                    userDetails=>
                                    {
                                        anInstence.UserDetails = userDetails.data;
                                    } 
                                )
                            }
                        );
                    });
                
                var tempArray = this.state.dataArray;
                tempArray.push(anInstence);
                this.setState({dataArray: tempArray});
            })
        })
        .catch(err=>{
            alert(err.response.data);
            console.log(err);
        });
    }
    render(){
        return <button onClick={this.loadData}>click</button>
    }
}

export default TodayIncome;
